member.summary:
只拷贝值域(包括string),忽略引用域;(包含共有,私有及保护成员)
异常:1.当参数为空时引发 ArgumentNullException ;
     2.当目标类型不同与源类型时(完全相同)引发 ArgumentException("Type unmatched.").

浅表拷贝,拷贝值域(包括string)的值,同时拷贝引用域的引用;(包含共有,私有及保护成员)
异常:1.当参数为空时引发 ArgumentNullException ;
     2.当目标类型不同与源类型时(完全相同)引发 ArgumentException("Type unmatched.").

完全拷贝整个对象及其引用树的值域(包含共有,私有及保护成员)
异常:1.当参数为空时引发 ArgumentNullException ;
     2.当目标类型不同与源类型时(完全相同)引发 ArgumentException("Type unmatched.").
